   304        <h1 id="firstHeading">Psychostrata</h1>
   305        <div id="siteSub">From Wikipedia, the free encyclopedia</div>
   306        <div id="contentSub"></div>
   307
   308        <table class="ambox">
   309            <tr>
   310                <td><b>This article describes layers of consciousness that cannot be directly observed.</b> Verification requires specialized introspective techniques. <small><i>(January 2026)</i></small></td>
   311            </tr>
   312        </table>
   313
   314        <table class="infobox">
   315            <tr>
   316                <td colspan="2" class="infobox-title">Psychostrata</td>
   317            </tr>
   318            <tr>
   319                <th scope="row">Also known as</th>
   320                <td>Mental strata, Consciousness layers, Cognitive sediments</td>
   321            </tr>
   322            <tr>
   323                <th scope="row">Field</th>
   324                <td><a href="consciousness-archaeology.html">Consciousness archaeology</a>, <a href="/wiki/Depth_psychology">Depth psychology</a></td>
   325            </tr>
   326            <tr>
   327                <th scope="row">First described</th>
   328                <td>1975</td>
   329            </tr>
   330            <tr>
   331                <th scope="row">Described by</th>
   332                <td>Dr. Amara Okonkwo</td>
   333            </tr>
   334            <tr>
   335                <th scope="row">Number identified</th>
   336                <td>Seven (canonical model)</td>
   337            </tr>
   338            <tr>
   339                <th scope="row">Related concepts</th>
   340                <td><a href="temporal-debt.html">Temporal debt</a>, <a href="mnemonic-commons.html">Mnemonic commons</a>, <a href="/wiki/Collective_unconscious">Collective unconscious</a></td>
   341            </tr>
   342        </table>
   343
   344        <p><b>Psychostrata</b> (singular: <b>psychostratum</b>; from Greek <i>psyche</i>, "soul/mind" + Latin <i>stratum</i>, "layer") are the hypothesized layers of consciousness proposed by the <a href="consciousness-archaeology.html">Stratigraphic Model of Mind</a>. First systematically described by Dr. Amara Okonkwo in her 1975 paper "The Stratigraphic Model of Mind," the concept proposes that conscious experience deposits layered "sediments" analogous to geological strata, with the most recent experiences forming the accessible surface and older experiences compressed into deeper, denser layers.<sup><a href="#cite1">[1]</a></sup></p>
   345
   346        <p>The psychostrata framework has become foundational to <a href="consciousness-archaeology.html">consciousness archaeology</a> and has influenced related fields including <a href="mnemonic-commons.html">mnemonic commons theory</a> and <a href="temporal-debt.html">temporal debt studies</a>. While controversial in mainstream cognitive science, the model continues to be refined and applied in therapeutic and research contexts.<sup><a href="#cite2">[2]</a></sup></p>
